import React, { useState, useEffect } from 'react';
import { getClientes } from './services/api'; // Importando a função

function App() {
  const [clientes, setClientes] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');

  // Função para carregar os dados dos clientes
  useEffect(() => {
    // Chama a função getClientes do serviço
    getClientes()
      .then(data => setClientes(data))
      .catch(error => console.log(error));
  }, []);

  const buscarClientes = (e) => {
    setSearchTerm(e.target.value);
  };

  const filteredClientes = clientes.filter(cliente =>
    cliente.nome.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="App">
      <h1>Body Builders</h1>
      <button onClick={() => alert('Adicionar novo cliente')}>Adicionar</button>

      <div className="search-container">
        <input
          type="text"
          placeholder="Digite qualquer palavra para pesquisa"
          onChange={buscarClientes}
        />
      </div>

      <table>
        <thead>
          <tr>
            <th>Academia</th>
            <th>CPF</th>
            <th>Nome</th>
            <th>Peso</th>
            <th>Altura</th>
            <th>Idade</th>
            <th>Estilo BodyBuilder</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {filteredClientes.map((cliente, index) => (
            <tr key={index}>
              <td>{cliente.academia}</td>
              <td>{cliente.cpf}</td>
              <td>{cliente.nome}</td>
              <td>{cliente.peso}</td>
              <td>{cliente.altura}</td>
              <td>{cliente.idade}</td>
              <td>{cliente.estilo}</td>
              <td><button onClick={() => alert(`Editando cliente ${cliente.nome}`)}>Editar</button></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
